import React from 'react';
import { Body } from './Body';
import { Footer } from './Footer';

export class App extends Component {


    render() {
        return (
            <div>
                <Header />
                <Body />
                <Footer />
            </div>
        )
    }
}
function Header() {
    return (
        <header className="header">
            <h1>Welcome to my to do list</h1>
        </header>
    )
}
export default App;
